import Tweet from "./Tweet";
import Nav from "./nav";
import About from "./About";
import Shop from "./Shop";
import { BrowserRouter as Router, Switch, Route, link } from 'react-router-dom';

function App() {

    const [users, setUsers] = useState(
        [
            { name: "Cha Eun Woo", message: "I am an actor, singer and model" },
            { name: "Jung Hae In", message: "I am an actor" },
            { name: "Lee Jung Suk", message: "I am an actor" },
            { name: "Kim Soo Hyun", message: "I am an actor" }
        ]
    );
    const [count, setCount] = useState(0);
    const increment = () => {
        setCount(count + 1);
    }

    return ( <
        Router >
        <
        div className = 'navApp' >
        <
        Nav / >
        <
        Route path = "/about"
        component = { About } > < /Route> <
        Route path = "/shop"
        component = { Shop } > < /Route> <
        Shop / >
        <
        About / >
        <
        /div> <
        /Router>

    )

}

export default App;
